import React, { Component } from "react";
import Form from "react-bootstrap/Form";
class addWallet extends Component {
  constructor() {
    super();
    this.state = {
      modal: false,
      wallet: 0
    };
  }

  toggle = () => {
    this.setState({
      modal: !this.state.modal
    });
  };
  handleChange = event => {
    this.setState({
      wallet: event.target.value
    });
  };

  render() {
    return <div>hello</div>;
  }
}
export default addWallet;
